import React from 'react';
import TableHeader from 'components/Jobs/ListViewSitterJobs/TableHeader';
import TableBody from 'components/Jobs/ListViewSitterJobs/TableBody';
 
const SitterJob = (props) => {
    const {data} = props;
    return ( 
        <table className="table">

          <TableHeader  />

          <TableBody data={data}/>
          
      </table>
     );
}
 
export default SitterJob;
